  padding-top: 0;
}
.layui-layer-tab {
  box-shadow: 1px 1px 50px rgba(0, 0, 0, 0.4);
}
.layui-layer-tab .layui-layer-title {
  padding-left: 0;
  overflow: visible;
}
.layui-layer-tab .layui-layer-title span {
  position: relative;
  display: inline-block;
  vertical-align: top;
  border-left: 1px solid transparent;
  border-right: 1px solid transparent;
  min-width: 80px;
  max-width: 300px;
  padding: 0 16px;
  text-align: center;
  cursor: default;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  cursor: pointer;
}
.layui-layer-tab .layui-layer-title span.layui-this {
  height: 51px;
  border-left-color: #eee;
  border-right-color: #eee;
  background-color: #fff;
  z-index: 10;
}
.layui-layer-tab .layui-layer-title span:first-child {
  border-left-color: transparent;
}
.layui-layer-tabmain {
  line-height: 24px;
  clear: both;
}
.layui-layer-tabmain .layui-layer-tabli {
  display: none;
}
.layui-layer-tabmain .layui-layer-tabli.layui-this {
  display: block;
}
.layui-layer-photos {
  background: 0 0;
  box-shadow: none;
}
.layui-layer-photos .layui-layer-content {
  overflow: visible;
  text-align: center;
}
.layui-layer-photos .layer-layer-photos-main img {
  position: relative;
  width: 100%;
  display: inline-block;
  /* *display: inline;
    *zoom: 1; */
  vertical-align: top;
}
.layui-layer-photos-next,
.layui-layer-photos-prev {
  position: fixed;
  top: 50%;
  width: 52px;
  height: 52px;
  line-height: 52px;
  margin-top: -26px;
  cursor: pointer;
  font-size: 52px;
  color: #717171;
}
.layui-layer-photos-prev {
  left: 32px;
}
.layui-layer-photos-next {
  right: 32px;
}
.layui-layer-photos-next:hover,
.layui-layer-photos-prev:hover {
  color: #959595;
}
.layui-layer-photos-toolbar {
  position: fixed;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100%;
  height: 52px;
  line-height: 52px;
  /* background-color: #000\9; */
  filter: alpha(opacity=60);
  background-color: rgba(0, 0, 0, 0.32);
  color: #fff;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
  font-size: 0;
}
.layui-layer-photos-toolbar > * {
  display: inline-block;
  vertical-align: top;
  padding: 0 16px;
  font-size: 12px;
  color: #fff;
  /* *display: inline;
    *zoom: 1 */
}
.layui-layer-photos-toolbar * {
